import React from "react";

function Portfolio(props) {
    
    const student = props;

    console.log(student);

    return ( 
        <>
            {student.data.map((post,index)=>(
                <div key={index}>
                    <div>
                        <img src={post.images[0].path} alt=""/>
                        <div>{post.name}</div>
                    </div>
                </div>
            ))}
        </>
    )
}

export default Portfolio
